import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Avatar from '@material-ui/core/Avatar';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles({
  avatar: {
    margin: 10,
  },
  bigAvatar: {
    margin: 10,
    width: 60,
    height: 60,
  },
});

function ImageAvatars() {
  const classes = useStyles();

  return (
    <Grid container justify="center" alignItems="center">
      <Avatar alt="Remy Sharp" src="https://image.flaticon.com/icons/png/512/146/146024.png" className={classes.avatar} />
      <Avatar alt="Remy Sharp" src="https://www.google.es/imgres?imgurl=https%3A%2F%2Fpng.pngtree.com%2Fsvg%2F20170602%2F0db185fb9c.png&imgrefurl=https%3A%2F%2Fpngtree.com%2Ffree-icon%2Favatar_107646&docid=2adbDmqTfyuWEM&tbnid=czL_TmVGhuxu1M%3A&vet=10ahUKEwjH3OiF-8LiAhXaDmMBHUnUB64QMwhsKB4wHg..i&w=512&h=512&bih=510&biw=1071&q=avatar%20icon&ved=0ahUKEwjH3OiF-8LiAhXaDmMBHUnUB64QMwhsKB4wHg&iact=mrc&uact=8" className={classes.bigAvatar} />
    </Grid>
  );
}

export default ImageAvatars;
